function Books() {


  const token = localStorage.getItem('token')
  console.log(token)
  if(token){
  return (
    
    <div>
      <h1>hey</h1>
    </div>

  )}
  else {
    return(
      <div><h1>No</h1></div>
    )
  }
}

export default Books;
